import React from "react";
import { Handle } from "react-flow-renderer";

export default function CustomHandle(props) {
  return (
    <>
    {props.type === "source" ?
        <Handle
        type="source"
        id={"0"}
        style={{ left: "50%", width: "12px", height: "12px" }}
        position="bottom"
        onConnect={(params) =>
            sharedFunctions.connectSdf(params.source, params.target, params)
        }
        />
        :
        <Handle
        type="target"
        id={"0"}
        style={{ left: "50%", width: "12px", height: "12px" }}
        position="top"
        onConnect={(params) =>
            sharedFunctions.connectSdf(params.source, params.target, params)
        }
        />
    }
    </>
  );
}
